useEffect(() => {
  const url = 'http://example.com/comic'; // Replace with your actual URL
  console.log('Requesting URL:', url); // Log the URL being requested

  axios.get(url)
    .then(response => {
      console.log('Response data:', response.data); // Log the response data
      setComic(response.data.url);
      setTitle(response.data.title);
    })
    .catch(error => {
      console.error('Error fetching the comic:', error);
      if (error.response) {
        console.error('Error response status:', error.response.status); // Log status code
        console.error('Error response data:', error.response.data); // Log response data
      }
    });
}, []);
